BASE_OUTPUT_DIR = os.getenv("BASE_OUTPUT_DIR", "generated_output")
RESULTS_OUTPUT_DIR = os.getenv("RESULTS_OUTPUT_DIR", "results")


def load_time_vars():
    sample_times = []

    # The env vars should contain comma separated time values
    start_times_var = os.getenv("SAMPLING_START_TIMES", "")
    stop_times_var = os.getenv("SAMPLING_STOP_TIMES", "")
    time_format = os.getenv("TIME_FORMAT", "%Y-%m-%d %H:%M:%S")

    if time_format == "RFC3339":
        start_times = [datetime.fromisoformat(ts.strip()) for ts in start_times_var.split(",") if ts.strip()]
        stop_times = [datetime.fromisoformat(ts.strip()) for ts in stop_times_var.split(",") if ts.strip()]
    else:
        start_times = [datetime.strptime(ts.strip(), time_format) for ts in start_times_var.split(",") if
                       ts.strip()]
        stop_times = [datetime.strptime(ts.strip(), time_format) for ts in stop_times_var.split(",") if ts.strip()]

    if len(start_times) == 0 or len(stop_times) == 0:
        raise ValueError("Error SAMPLING_START_TIMES and SAMPLING_STOP_TIMES env vars must have at least one value.")
    if len(start_times) != len(stop_times):
        raise ValueError(
            "Error: Number of start and end timestamps in SAMPLING_START_TIMES and SAMPLING_STOP_TIMES env vars doesn't match.")
    for start, stop in zip(start_times, stop_times):
        sample_times.append((start, stop))

    return sample_times


