def main():
    sample_times = load_time_vars()

    i = 0
    for start, stop in sample_times:
        # Prepare output dir name
        results_dir_name = RESULTS_OUTPUT_DIR
        if len(sample_times) > 1:
            results_dir_name = results_dir_name + "-" + str(i + 1)

        print("\n==================================")
        print(f"Entry {i + 1}/{len(sample_times)}: containing data from {start} to {stop}")
        print("==================================")
        processing_start_time = datetime.now()

        process_data_entry(start, stop, f"{BASE_OUTPUT_DIR}/{results_dir_name}")

        processing_end_time = datetime.now()
        duration = processing_end_time - processing_start_time
        print(f"\nProcessing duration: {duration}")
        print(f"Took {duration.total_seconds()} seconds")
        i += 1


if __name__ == '__main__':
    main()
